    public static StructurePredefinedInput CreatePredefinedInput(string structureType, string fieldName, string fieldValue,
        bool isReadOnly = true)
    {
        var values = new StructurePredefinedInput
        {
            StructType = structureType,
            FieldValues =
            {
                [fieldName] = new PredefinedField()
                    { Value = fieldValue, IsReadOnly = isReadOnly }
            }
        };
        return values;
    }
